import { StyleSheet } from "react-native";
import { padding, 
    Colors, 
    fontSize, 
    fontFamily, 
    windowWidth, 
    normalize }  from "../../../settings/styles/theme";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: "center"
    },
    containerpart1: {
        flex: 1,
        height: 200,
        marginTop: 174,
        justifyContent: "center",
        alignItems: "center",
    },
    containerpart2: {
        flex: 1,
        marginTop: 130,
        justifyContent: "center",
        alignItems: "center",
    },
    containerpart3: {
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
    },
    text:{
        color: Colors.PRIMARY,
        fontSize: 16,
        fontWeight: "bold"
    },
    logoImage: {
        width:220,
        height: 170
        
    },
    inputStyle:{
        backgroundColor: 'rgba(0,0,0,0)',
        borderColor: '#fff',
        borderWidth: 1.5,
        borderRadius: 3,
        width: 292,
        height: 49
    },
    submitContainer: {
        backgroundColor: "#fff",
        borderRadius: 3,
        width: 292,
        height: 49,
        justifyContent: "center",
        alignItems: "center",
    }
});

export default styles;
